async function UpdateAnswers() {
    // // Use connect method to connect to the server
    var client = await MongoClient.connect(url);

    console.log("Connected successfully to server");

    const db = client.db(dbName);
    //console.log(db);

    const collection = db.collection('UserSubjectProgress');
    // Find some documents
    var progress = await collection.find({}).toArray();

    var txt = "";

    var updates = [];
    var updatesQuestions = [];

    progress.forEach(function (mod, index) {
        var hastoupdate = false;
        if (mod.answers && mod.answers.length > 0) {
            for (var j = 0; j < mod.answers.length; j++) {
                var answer = mod.answers[j];

                var key =`${mod.moduleId.toString()}-${mod.subjectId.toString()}-${answer.questionId.toString()}`
                if(newQuestionIds[key]){
                    answer.questionId = new ObjectId(newQuestionIds[key]);
                    updates.push(answer);

                    if(answer.answerId){
                        key += `-${answer.answerId.toString()}`
                        if(newAnswerIds[key]){
                            answer.answerId = new ObjectId(newAnswerIds[key]);
                        }
                    }
                    hastoupdate = true;
                }
            }
        }
        if (mod.questions && mod.questions.length > 0) {
            for (var j = 0; j < mod.questions.length; j++) {
                var answer = mod.questions[j];

                var key =`${mod.moduleId.toString()}-${mod.subjectId.toString()}-${answer.questionId.toString()}`
                if(newQuestionIds[key]){
                    answer.questionId = new ObjectId(newQuestionIds[key]);
                    updatesQuestions.push(answer);

                    if(answer.answerId){
                        key += `-${answer.correctAnswerId.toString()}`
                        if(newAnswerIds[key]){
                            answer.correctAnswerId = new ObjectId(newAnswerIds[key]);
                        }
                    }
                    hastoupdate = true;
                }
            }
        }
        if(hastoupdate){
            // collection.updateOne({
            //     _id: mod._id
            // }, {
            //     $set: {
            //         questions: mod.questions,
            //         answers: mod.answers
            //     }
            // }, function (err, result) {
            //     assert.equal(err, null);
            //     console.log(index);
            // });
        }
    });

    console.log(updates.length);
    console.log("acabou");

}
UpdateAnswers();


